var certificateModule = (function(){
    
    return {
        generateCertificate: function(data, name){
            var imageData = "data:image/png;base64,"
            
            
            
            // create docuemtn
            var doc = new jsPDF();
            doc.addImage(imageData,"PNG",15,40,180,140);

            //add text
            doc.setFont("times");
            doc.setFontType("italic");
            doc.setTextColor(29,210,242);
            doc.setFontSize(21);
            doc.text(100,70,"TYPING SPEED CERTIFICATE","center");

            

            doc.setTextColor(96,96,96);
            doc.setFontSize(14);
            doc.text(100,80,"This Certificate is Hereby Awarded to:","center");

            //Add name

            doc.setTextColor(29,210,242);
            doc.setFontSize(19);
            doc.text(100,90,name,"center");

            doc.setTextColor(96,96,96);
            doc.setFontSize(12);
            doc.text(100,100,"For Achieving Results noted below as documented","center");

            doc.setTextColor(96,96,96);
            doc.setFontSize(12);
            doc.text(100,110,"and verified by Canadian  Association of Typewriters","center");
            
            //add results
            var level = event.target.getAttribute("level");
            doc.setTextColor(96,96,96);
            doc.setFontSize(14);
            doc.text(100,120,"Level:" + level,"center");

            doc.setTextColor(96,96,96);
            doc.setFontSize(14);
            doc.text(100,130,"Average Speed: " + data.wpm + " wpm","center");

            doc.setTextColor(96,96,96);
            doc.setFontSize(14);
            doc.text(100,140,"Accuracy: " + data.accuracy + "%","center");
            
            var now = new Date();
            doc.setTextColor(96,96,96);
            doc.setFontSize(10);
            doc.text(142,153,"Awarded on: " + (now.getMonth() + 1) + "/" + now.getDate() + "/" + now.getFullYear());

            doc.setTextColor(96,96,96);
            doc.setFontSize(10);
            doc.text(122,160,"Canadian  Association of Typewriters");


            doc.save("Certificate.pdf");
        }
    };
})();